css:
body {
  font-size: 11px;
  color: #a8a8a8;
  background-color: #000000;
}
atom-pane {
  border-right: 1px solid #000000;
}
atom-pane:last-child {
  border-right: none;
}
.btn {
  color: #b8b8b8;
  background-color: #212224;
}
.btn:hover,
.btn:focus {
  color: #f0f0f0;
  background-color: #2d2f31;
}
.btn:active {
  color: rgba(255, 255, 255, 0.66);
  background-color: #1c1d1f;
}
.btn.selected {
  color: #ffffff;
  background-color: #000000;
}
.btn:focus,
.btn:focus:active {
  outline: none;
}
.btn.btn-primary {
  color: #ffffff;
  background-color: #0088ff;
}
.btn.btn-primary:hover,
.btn.btn-primary:focus {
  background-color: #1492ff;
}
.btn.btn-primary:active {
  background-color: #007deb;
}
.btn.btn-primary.selected {
  background-color: #1492ff;
}
.btn.btn-primary.selected:focus,
.btn.btn-primary.selected:hover {
  background-color: #299bff;
}
.btn.btn-info {
  color: #ffffff;
  background-color: #0088ff;
}
.btn.btn-info:hover,
.btn.btn-info:focus {
  background-color: #1492ff;
}
.btn.btn-info:active {
  background-color: #007deb;
}
.btn.btn-info.selected {
  background-color: #1492ff;
}
.btn.btn-info.selected:focus,
.btn.btn-info.selected:hover {
  background-color: #299bff;
}
.btn.btn-success {
  color: #ffffff;
  background-color: #9af9c2;
}
.btn.btn-success:hover,
.btn.btn-success:focus {
  background-color: #aefacd;
}
.btn.btn-success:active {
  background-color: #87f7b6;
}
.btn.btn-success.selected {
  background-color: #aefacd;
}
.btn.btn-success.selected:focus,
.btn.btn-success.selected:hover {
  background-color: #c1fbd9;
}
.btn.btn-warning {
  color: #ffffff;
  background-color: #ffffff;
}
.btn.btn-warning:hover,
.btn.btn-warning:focus {
  background-color: #ffffff;
}
.btn.btn-warning:active {
  background-color: #ebebff;
}
.btn.btn-warning.selected {
  background-color: #ffffff;
}
.btn.btn-warning.selected:focus,
.btn.btn-warning.selected:hover {
  background-color: #ffffff;
}
.btn.btn-error {
  color: #ffffff;
  background-color: #ff9999;
}
.btn.btn-error:hover,
.btn.btn-error:focus {
  background-color: #ffadad;
}
.btn.btn-error:active {
  background-color: #ff8585;
}
.btn.btn-error.selected {
  background-color: #ffadad;
}
.btn.btn-error.selected:focus,
.btn.btn-error.selected:hover {
  background-color: #ffc2c2;
}
.btn-group > .btn {
  border-color: rgba(0, 0, 0, 0.2);
}
atom-text-editor[mini] {
  padding-left: 5px;
  color: #a8a8a8;
  border-radius: 2px;
  background-color: #212224;
}
atom-text-editor[mini].is-focused {
  background-color: #151517;
}
atom-text-editor[mini] .placeholder-text {
  color: #808080;
}
atom-text-editor[mini] .selection .region {
  background-color: #4182C4;
}
.icon-right {
  font-size: 14px;
  padding-left: 8px !important;
  padding-right: 8px !important;
  cursor: pointer;
}
.find-and-replace {
  border-top: 1px solid #000000;
}
.status {
  color: #a8a8a8;
}
.status-added {
  color: #2BDA77;
}
.status-ignored {
  color: #808080;
}
.status-modified {
  color: #ff982d;
}
.status-removed {
  color: #c00;
}
.status-renamed {
  color: #5293d8;
}
.key-binding {
  display: inline-block;
  margin-left: 1px;
  padding: 0 5px;
  line-height: 2;
  font-family: 'Helvetica Neue', Arial, sans-serif;
  font-size: .8em;
  letter-spacing: 1px;
  border-radius: 2px;
  background-color: #000000;
}
.list-group li {
  padding-left: 5px;
}
.list-group li.selected {
  color: #ffffff;
  background-color: #4182C4;
}
.list-group li.selected:before {
  display: none;
}
.list-tree {
  color: #a8a8a8;
}
.list-tree .selected {
  color: #ffffff;
}
.select-list li {
  padding: 5px 10px;
}
.select-list .status {
  float: right;
}
.select-list.popover-list {
  padding: 5px;
  border-radius: 2px;
  background-color: #000000;
  box-shadow: 0 2px 8px 1px rgba(0, 0, 0, 0.3);
}
.select-list.popover-list .list-group {
  margin-top: 5px;
}
.select-list.popover-list .list-group li {
  padding-left: 5px;
}
.panel-heading {
  border-bottom: 1px solid #000000;
  background-color: #000000;
}
.inset-panel {
  background-color: #000000;
}
.inset-panel .panel-heading {
  background-color: #000000;
}
.package-card {
  background-color: #000F1A !important;
}
atom-panel.modal {
  border: 1px solid rgba(255, 255, 255, 0.07);
  border-top: none;
  box-shadow: 0 2px 8px 1px rgba(0, 0, 0, 0.3);
}
.loading-spinner-large {
  display: block;
  width: 64px;
  height: 64px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 64px 64px;
}
.loading-spinner-large.inline-block {
  display: inline-block;
}
.loading-spinner-medium {
  display: block;
  width: 48px;
  height: 48px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 48px 48px;
}
.loading-spinner-medium.inline-block {
  display: inline-block;
}
.loading-spinner-small {
  display: block;
  width: 32px;
  height: 32px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 32px 32px;
}
.loading-spinner-small.inline-block {
  display: inline-block;
}
.loading-spinner-tiny {
  display: block;
  width: 16px;
  height: 16px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 16px 16px;
}
.loading-spinner-tiny.inline-block {
  display: inline-block;
}
.ui-site-1 {
  background-color: #9af9c2;
}
.ui-site-2 {
  background-color: #0088ff;
}
.ui-site-3 {
  background-color: #ffffff;
}
.ui-site-4 {
  background-color: #db2ff4;
}
.ui-site-5 {
  background-color: #f5e11d;
}
.status-bar {
  font-size: 11px;
  color: #a8a8a8;
  border-top: 1px solid #000000;
  background-color: #000000;
}
.tab-bar {
  background-color: #000000;
}
.tab-bar .tab {
  color: #a8a8a8;
  line-height: 4rem;
  font-size: 11px;
  background-color: #212224;
}
.tab-bar .tab.active {
  color: #ffffff;
  background-color: #000000;
}
.tab-bar .tab.modified:not(:hover) .close-icon {
  top: 50%;
  right: 14px;
}
.tab-bar .tab.modified:hover .close-icon {
  color: currentColor;
}
.tab-bar .tab .close-icon:hover {
  color: #ffffff;
}
.tab-bar .tab.active .close-icon:hover {
  color: #a8a8a8;
}
.tab-bar .tab.is-dragging {
  background: #090909;
  border-color: transparent;
  opacity: .5;
}
.tab-bar .tab.is-dragging .close-icon {
  visibility: hidden;
}
.text-smaller {
  font-size: smaller;
}
.text-subtle {
  color: #808080;
}
.text-highlight {
  color: #f0f0f0;
}
.text-info {
  color: #5293d8;
}
.text-success {
  color: #2BDA77;
}
.text-warning {
  color: #ff982d;
}
.text-error {
  color: #c00;
}
.highlight {
  padding: 1px 4px;
  color: #f0f0f0;
  border-radius: 2px;
  background-color: rgba(255, 255, 255, 0.07);
}
.highlight-info {
  padding: 1px 4px;
  color: #f0f0f0;
  border-radius: 2px;
  background-color: #0088ff;
}
.highlight-warning {
  padding: 1px 4px;
  color: #f0f0f0;
  border-radius: 2px;
  background-color: #ffffff;
}
.highlight-error {
  padding: 1px 4px;
  color: #f0f0f0;
  border-radius: 2px;
  background-color: #ff9999;
}
.highlight-success {
  padding: 1px 4px;
  color: #f0f0f0;
  border-radius: 2px;
  background-color: #9af9c2;
}
.background-message {
  font-weight: bold;
  color: #808080;
}
.tooltip .tooltip-inner {
  line-height: 1;
  padding: .75em;
  white-space: nowrap;
  max-width: none;
}
.tooltip .keystroke {
  padding: .15em .4em;
  margin: 0 -0.3em 0 0.25em;
  border-radius: 2px;
  color: #ffffff;
  background: #4182C4;
}
.tree-view-resizer {
  border-right: 1px solid #000000;
}
.tree-view {
  color: #a8a8a8;
  background-color: #000000;
}
.tree-view .list-item.selected {
  color: #ffffff;
}
.tree-view .entry::before {
  margin-left: 12px;
  margin-right: 12px;
  background: #06c !important;
  cursor: pointer;
}
.list-tree.has-collapsable-children .list-nested-item > .list-item::before {
  position: relative;
  top: 0px;
  cursor: pointer;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  content: "\f0a3";
  padding-left: 5px;
  padding-right: 10px;
  font-size: 1.31em;
}
.list-item::before {
  cursor: pointer !important;
  display: inline-block;
  padding-left: 8px !important;
  padding-right: 12px !important;
  font-size: 13px !important;
}
